import { useEffect, useState } from 'react';
import './App.css';


function App() {

  const [data,setData] = useState([]);
  useEffect(() => {
    fetch('http://localhost/3001/santri').
    then(response => response.json().
    then(data => setData(data)))
  },[])
  return (
    <div>
      {
        data.map(item => {
          return <li key={item._id}>{item.name}</li>
        })
      }
    </div>
  )

}

export default App;
